import React, { useState } from 'react';
import { useAuth } from '../context/AuthContext';

function DebugPage() {
  const { user, isAuthenticated, loading, checkAuthState } = useAuth();
  const [logs, setLogs] = useState([]);
  const [cleared, setCleared] = useState(false);

  const addLog = (message) => {
    setLogs(prev => [...prev, { time: new Date().toISOString(), message }]);
  };

  const checkCriticalStorageKeys = () => {
    addLog('Checking for auth storage keys...');

    const keys = Object.keys(localStorage);
    addLog(`Found ${keys.length} total localStorage keys`);

    for (const key of keys) {
      try {
        const value = localStorage.getItem(key);
        if (value && (value.includes('token') || value.includes('user'))) {
          addLog(`⚠️ Sensitive data in localStorage: ${key.substring(0, 15)}...`);
        }
      } catch (e) {
        addLog(`Error reading key ${key}: ${e.message}`);
      }
    }
  };

  const refreshAuth = async () => {
    addLog('Manually refreshing auth state...');
    try {
      await checkAuthState();
      addLog('Auth state refreshed');
    } catch (e) {
      addLog(`Error refreshing auth: ${e.message}`);
    }
  };

  const clearLocalStorage = () => {
    addLog('Clearing localStorage...');
    try {
      localStorage.clear();
      addLog('localStorage cleared');
      setCleared(true);
    } catch (e) {
      addLog(`Error clearing localStorage: ${e.message}`);
    }
  };

  const checkSession = async () => {
    addLog('Checking session status...');

    try {
      await checkAuthState();

      if (isAuthenticated) {
        addLog(`Session active. User: ${user.email}`);
      } else {
        addLog('No active session found');
      }
    } catch (e) {
      addLog(`Error checking session: ${e.message}`);
    }
  };

  const checkConsole = () => {
    addLog('Outputting diagnostic info to console...');
    console.log('===== DEBUG PAGE DIAGNOSTICS =====');
    console.log('Auth State:', { isAuthenticated, user, loading });

    console.log('localStorage keys:');
    Object.keys(localStorage).forEach(key => {
      console.log(`- ${key}`);
    });

    addLog('Data sent to console');
  };

  return (
    <div className="min-h-screen bg-gray-900 text-white p-6">
      <div className="max-w-4xl mx-auto">
        <h1 className="text-2xl font-bold mb-6">System Diagnostics</h1>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-6 mb-8">
          <div className="bg-gray-800 p-4 rounded-lg">
            <h2 className="text-xl mb-4">Authentication Status</h2>
            <div><strong>Is Authenticated:</strong> {String(isAuthenticated)}</div>
            <div><strong>Is Loading:</strong> {String(loading)}</div>

            {user && (
              <div className="mt-4">
                <div><strong>User Email:</strong> {user.email}</div>
                <div><strong>User ID:</strong> {user.id}</div>
                <div><strong>Created At:</strong> {new Date(user.created_at).toLocaleString()}</div>
              </div>
            )}
          </div>

          <div className="bg-gray-800 p-4 rounded-lg">
            <h2 className="text-xl mb-4">Storage Status</h2>
            <div><strong>localStorage Keys:</strong> {Object.keys(localStorage).length}</div>
            <div><strong>Storage Cleared:</strong> {String(cleared)}</div>
          </div>
        </div>

        <div className="grid grid-cols-2 md:grid-cols-4 gap-4 mb-8">
          <button 
            onClick={checkCriticalStorageKeys}
            className="bg-blue-600 hover:bg-blue-700 text-white py-2 px-4 rounded"
          >
            Check Storage
          </button>

          <button 
            onClick={refreshAuth}
            className="bg-green-600 hover:bg-green-700 text-white py-2 px-4 rounded"
          >
            Refresh Auth
          </button>

          <button 
            onClick={clearLocalStorage}
            className="bg-red-600 hover:bg-red-700 text-white py-2 px-4 rounded"
          >
            Clear Storage
          </button>

          <button 
            onClick={checkSession}
            className="bg-purple-600 hover:bg-purple-700 text-white py-2 px-4 rounded"
          >
            Check Session
          </button>

          <button 
            onClick={checkConsole}
            className="bg-yellow-600 hover:bg-yellow-700 text-white py-2 px-4 rounded"
          >
            Log to Console
          </button>
        </div>

        <div className="bg-gray-800 p-4 rounded-lg">
          <h2 className="text-xl mb-4">Diagnostic Logs</h2>
          <div className="bg-black p-4 rounded h-64 overflow-y-auto font-mono text-sm">
            {logs.length === 0 ? (
              <div className="text-gray-500">No logs yet. Run diagnostics to see output here.</div>
            ) : (
              logs.map((log, i) => (
                <div key={i} className="mb-1">
                  <span className="text-gray-500">{new Date(log.time).toLocaleTimeString()}</span>{' '}
                  <span>{log.message}</span>
                </div>
              ))
            )}
          </div>
        </div>
      </div>
    </div>
  );
}

export default DebugPage;
